import { BrowserRouter as Router, Route, Switch } from "react-router-dom";

import "./App.css";
import JeansItem from "./app/components/JeansItem";
import Navbar from "./app/components/Navbar";
import Home from "./app/Home";
import Home3 from "./app/Home3";
import MensShop from "./app/MensShop";

function App() {
  return (
    <div>
      <Router>
        <Navbar />
        <Switch>
          <Route path="/" exact component={Home} />
          {/* <Route path="/products" component={Home3} /> */}
          <Route path="/products">
            <Route path="/" component={Home3} />
            <Route path="/mensShop" component={MensShop} />
          </Route>
          <Route path="/info" />
          {/* <Route path="/products/mensShop" component={MensShop} /> */}
          <Route path="/aboutUs" />
          <Route path="/account" />
          <Route path="/jeansItem" component={JeansItem} />
        </Switch>
      </Router>
    </div>
  );
}

export default App;
